import React from "react";
import "./About.css";

const About = () => {
  return (

    <div className="divbox-container">
      {/* Left Side: Text */}
      <div className="divbox-text">
        <h2>Explore Our New Collection</h2>
        <p>
          Discover the latest trends and designs crafted just for you. 
          Perfect for every occasion and every mood.
        </p>
      </div>

      {/* Right Side: Image */}
      <div className="divbox-image">
        <img src="/assets/Hero5.png" alt="New Collection" />
      </div>
    </div>
  );
};

export default About;
